css:
@-moz-document domain("mgsm.pl") {
body {
    margin: 0;
    background: #0a0a0a;
    font-family: Arial,"Helvetica Neue",Helvetica,Roboto,sans-serif;
    font-weight: 400;
    line-height: 1.5;
    color: #ccc;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
}
.header-container {
    padding-top: 2px;
    box-shadow: 0 1px 5px #888;
    border-bottom: 2px solid #acacac;
    margin: auto;
    width: 100%;
    background: #767676;
    position: fixed;
    z-index: 999;
    overflow: scroll;
}
.phoneCategoryValue {
    color: #dfdfdf;
}
.phoneCategoryName {
    color: #dfdfdf;
}
#dictTipMiddle {
    background: #312d2d;
    border-left: 1px solid #dfdfdf;
    font-size: 12px;
    padding: 10px;
    position: relative;
    border-bottom-left-radius: 10px;
    border-bottom-right-radius: 10px;
}

}
